import './styles/LateralMenu.css';

class LateralMenu extends React.Component{

	render(){

		return(
			<div id="divStyleMenu">
				<p>COMPANIES</p>
				<p className="pUserStyleMenu">USUÁRIOS</p>
				<p>RESETAR SENHA</p>
				<p>SIMULAÇÃO</p>
			</div>
		);
	}
}

export default LateralMenu;
